import React from "react";
import single from "./images/single.png";

const Cards = () => {
  return (
    <div className="w-full py-[10rem] px-4 bg-white">
      <div className="max-w-[1240px] mx-auto-grid grid-cols-3 gap-8">
        <div className="w-full shadow-xl flex flex-col p-4 m-8 rounded-lg hover:scale-105 duration-300">
          <img className="w-20 mx-auto bg-white" src={single} alt="" />
          <h2 className="text-2xl font-bold text-center py-8">Single User</h2>
          <p className="text-center text-4xl font-bold">Rs.150</p>
          <div className="text-center font-medium">
            <p className="py-2 border- mx-8 ">500GB Storage</p>
            <p className="py-2 border- mx-8 ">1 granted User</p>
            <p className="py-2 border- mx-8 ">Send upto 2GB</p>
          </div>
          <button>Start Trial</button>
        </div>
      </div>
    </div>
  );
};

export default Cards;
